import lombok.Getter;import lombok.ToString;import java.time.LocalDate;@Getter@ToString(callSuper = true)public class Enseignant extends Personne {  private final String specialite;  public Enseignant(int id, String nom, String prenom, LocalDate dateNaissance, String email, String numeroTel, String specialite) {    super(id, nom, prenom, dateNaissance, email, numeroTel);    this.specialite = specialite;  }}